pragma solidity ^0.6.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

/// @author Solidity Services
/// @title Galaxis: Uniswap adapter
/// @notice Handles communication with Uniswap
contract GX_UniswapAdapter {

    address internal constant UNISWAP_ROUTER_ADDRESS = 0x7a250d5630B4cF539739dF2C5dAcb4c659F2488D ;

    IUniswapV2Router02 public uniswapRouter;
    address private multiDaiKovan = 0x4F96Fe3b7A6Cf9725f59d353F723c1bDb64CA6Aa;

    constructor() public {
        uniswapRouter = IUniswapV2Router02(UNISWAP_ROUTER_ADDRESS);
    }

    function convertEthToDai(uint daiAmount) public payable {
        uint deadline = now + 15; // using 'now' for convenience, for mainnet pass deadline from frontend!
        uniswapRouter.swapETHForExactTokens.value(msg.value)(daiAmount, getPathForETHtoDAI(), address(this), deadline);

        // refund leftover ETH to user
        msg.sender.call.value(address(this).balance)("");
    }

    function getEstimatedETHforDAI(uint daiAmount) internal view returns (uint[] memory) {
        return uniswapRouter.getAmountsIn(daiAmount, getPathForETHtoDAI());
    }

    function getPathForETHtoDAI() private view returns (address[] memory) {
        address[] memory path = new address[](2);
        path[0] = uniswapRouter.WETH();
        path[1] = multiDaiKovan;

        return path;
    }

    function getPath(address _tknOffer, address _tknGet) private view returns (address[] memory) {
        address[] memory path = new address[](2);
        path[0] = _tknOffer;
        path[1] = _tknGet;

        return path;
    }

    function swapTokensUniswap (address _tknOffer, address _tknGet, uint _amount, address _toAddress, address _dexManagerAddress) internal {
        uint deadline = now + 15; // using 'now' for convenience, for mainnet pass deadline from frontend!

        // making swap by uniswap
        uniswapRouter.swapExactTokensForTokens(
            _amount,
            0,
            getPath(_tknOffer, _tknGet),
            _toAddress,
            deadline
        );

        // sending remaining tokens back: hack for inheritance
        IERC20 tknOffer = IERC20(_tknOffer);
        uint remaining = tknOffer.allowance(_toAddress, _dexManagerAddress);
        if (remaining > 0) {
            tknOffer.transferFrom(_dexManagerAddress, _toAddress, remaining);
        }

    }


}

